func area(shape:Shape)->Double{
 switch shape {
 case let .Circle(centerX: _, centerY: _, radius: radius):
 return M_PI*radius*radius
 case let .Rectangle(width,height):
 return width*height

 case let .Square(side):
 return side*side
 case .Point:
 return 0
 }
}

